  render(){
    return(
      <Grid columns='equal' className="app" style={{background: '#eee'}}>
        <HeaderPanel />
        <Menu size='large'
          fixed='left'
          vertical
          style={{background: '#4c3c4c'}}
        >

        </Menu>
        <Grid.Column width={4}>
          2
        </Grid.Column>
        <Grid.Column>
          3
        </Grid.Column>
      </Grid>

    )
  }
}

export default App;
